import React from 'react';
import "../card.css";
import data from "../data.json";



export function NomeComponente({status}) {
  return (
    <div>
      {status.true ? <h1>Nome Ativado</h1> : <h1>Nome Desativado</h1>}
    </div>
  );
}



export default function Card() {
  return (
   data.Vagas.map((dados) => {
      return (
        
 <div className="container" >
      <div className='card card1'key={dados.id}>
        <img src={dados.logo} alt="minha imagem" />
        <div className='descript-left'>
          <div className="descript-cabecalho">
                <span>{dados.company}</span> <div>{dados.true ? <span>{dados.new}</span> :  <span></span>}</div> <span>{dados.featured}</span>
          </div>

          <div className="title">
            <h4>{dados.position}</h4>
          </div>

          <div className='descript-footer'>
            <span>{ dados.postedAt + " - "}</span> <span>{dados.contract + " - "}</span> <span>{dados.location }</span>
          </div>

        </div>

        <div className='descript-right'>
          <span>{dados.role}</span>  <span>{dados.level}</span>  <span>{dados.languages}</span>
        </div>

      </div >

    </div>
      )
    })
   
  );
}
